import React, { Component } from 'react'

export default class State extends Component {

    state = {
        deneme: "deneme",
        arr: [
            { id: 1, name: "ahmet" },
            { id: 2, name: "mehmet" },
            { id: 3, name: "mehmet" }
        ]
    }

    render() {
        return (
            <div>
                <p> 
                    {this.state.arr.map(data => data)}
            
                </p>

                <p>
                    {this.state.deneme}
                </p>
            </div>


        );
    }
}
